import Container from "../components/container/Container";
import { Row, Col } from "react-simple-flex-grid";
import className from "classnames";

export default () => (
  <div className="home-bg" style={{ marginTop: "5rem", position: "fixed" }}>
    <div style={{ padding: "5rem 15rem 13rem 15rem", height: "80vh" }}>
      <h1 style={{ color: "navy", fontSize: "2.7rem", letterSpacing: "2.5px" }}>
        Hello Folks, we are Transcend Studio.
      </h1>
      <Col md={5}>
        <h3 style={{ margin: "0px" }}>We create digital experiences</h3>
      </Col>
      <Col md={2}>
        <div
          style={{
            width: "100px",
            height: "3px",
            backgroundColor: "navy",
            margin: "15px"
          }}
        />
      </Col>
      <Col md={4}>
        <h3 style={{ margin: "0px" }}>will help your business stand out.</h3>
      </Col>
    </div>
  </div>
);
